// src/components/OsobaList.js
import React, { useState, useEffect } from 'react';
import { getAllOsoby } from '../services/api';

const OsobaList = () => {
    const [osoby, setOsoby] = useState([]);
    const [isLoading, setIsLoading] = useState(true);

    const fetchOsoby = async () => {
        try {
            const response = await getAllOsoby();
            console.log(response.data); // Dodaj ten log
            setOsoby(response.data);
            setIsLoading(false);
        } catch (error) {
            console.error('Błąd podczas pobierania danych:', error);
            setIsLoading(false);
        }
    };

    useEffect(() => {
        fetchOsoby();
    }, []);

    return (
        <div>
            <h2>Lista Osób</h2>

            {isLoading ? (
                <p>Ładowanie danych...</p>
            ) : (
                <table>
                    <thead>
                    <tr>
                        <th>ID</th>
                        <th>Imię</th>
                        <th>Nazwisko</th>
                        <th>Numer Telefonu</th>
                        <th>Adres</th>
                        <th>Stanowisko Pracy</th>
                    </tr>
                    </thead>
                    <tbody>
                    {osoby.map((osoba) => (
                        <tr key={osoba.id}>
                            <td>{osoba.id}</td>
                            <td>{osoba.imie}</td>
                            <td>{osoba.nazwisko}</td>
                            <td>{osoba.numerTelefonu ? osoba.numerTelefonu.numer : 'Brak numeru'}</td>
                            <td>{osoba.adres ? `${osoba.adres.ulica}, ${osoba.adres.miasto}` : 'Brak adresu'}</td>
                            <td>{osoba.praca ? osoba.praca.nazwaStanowiska : 'Brak informacji o pracy'}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            )}
        </div>
    );
};

export default OsobaList;
